import React from "react";
import logo from "../../assets/logo.png";
import "./Signup.scss";

const Signup = () => {
  return (
    <div className="signup">
      <span className="logo">
        <span>
          <img src={logo} alt=""></img>
        </span>
        <span>
          <span className="yellow">E-</span>Shop
        </span>
      </span>
      <div className="form">
        <div className="title">LOGIN</div>
      </div>
    </div>
  );
};

export default Signup;
